  const [projects, setProjects] = useState([]);

  const { type } = useParams();
  console.log(type);

  useEffect(() => {
    axios.get(`http://localhost:5000/project/${type}`).then((res) => {
      setData(res.data);
      console.log(data);
    });
  }, []);


  return (
    <>
      {data.map((elem) => {
          return (
            <DisplayProjects
              name={elem.name}
              type={elem.type}
              desc={elem.desc}
              teamNeeded={elem.teamNeeded}
              level={elem.level}
            />
          );
        })}
    </>
  );
}
